import WaitingList from "./components/WaitingList";
import CreateParty from "./components/CreateParty";

function App() {
  const parties = [{ name: "Sam", key: 1 }, { name: "Liane", key: 2 }, { name: "Lisa", key: 3 }];

  console.log(parties);

  return (
    <div className="app mx-auto modal-container grid bg-blue-100 2-xl">
      <WaitingList parties={parties} />
      <CreateParty />
    </div>
  );
}

export default App;
